import React, {useState} from 'react';
import RandomUserApi from './RandomUserApi';
import './index.css'


function Table () {
    const [data, setdata] = useState(RandomUserApi)
    return (
        <div>
            <table>
            <thead>
                <tr>
                    <th>Last Name</th>
                    <th>First Name</th>
                    <th>Email</th>
                    <th>Cell Phone</th>
                    <th>DOB</th>
                </tr>
            </thead>
            <tbody>
                {data.map((d)=> (
                    <tr key={d.name.last}>
                    <td>{d.name.last}</td>
                    <td>{d.name.first}</td>
                    <td>{d.email}</td>
                    <td>{d.cell}</td>
                    <td>{d.dob}</td>
                </tr>

                ))}

            </tbody>
            </table>
        </div>
    )
}

export default Table;
